import React from "react";

const AddProd=(props)=>{
   const prodaddHandler=(event)=>{
    event.preventDefault();
   }

    return(
        <form onSubmit={prodaddHandler}>
            <label htmlFor="prodId">Product Id</label>
            <input type="text" id="prodId"></input>
            <label htmlFor="prodPrice">Selling Price</label>
            <input type="number" id="prodPrice"></input>
            <label htmlFor="prodName">Product Name</label>
            <input type="text" id="prodName"></input>
            <button type="submit" onClick=''>Add Product</button>
        </form>
    )
}

export default AddProd;
